import React from 'react';

import './style.css';

export default function SectionTrailer() {
    return (
        <section className="trailerAbout">
            <div className="text-about">
                <h1>Muito mais que cartãos emitidos.</h1>
                <p>Experiências vividas, sonhos realizados e <span> muita história para contar! </span></p>
            </div>

            <div className="trailer-about">
            <iframe width="560" height="315" src="https://www.youtube.com/embed/xWC6M6KiDBI" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>
        </section>
    )
}
